create table "Character"
(
    id                       varchar(255)                           not null
        primary key,
    name                     varchar(255)                           not null,
    profession               varchar(255),
    "birthDate"              date,
    "birthPlace"             varchar(255),
    gender                   varchar(255),
    "heightCm"               integer,
    "weightKg"               integer,
    age                      integer,
    "apparentAge"            integer,
    religion                 varchar(255),
    "secretSociety"          varchar(255),
    cabala                   varchar(255),
    rank                     varchar(255),
    mentor                   varchar(255),
    "societyAllies"          text[]       default ARRAY []::text[],
    "hitPoints"              integer,
    "currentHitPoints"       integer,
    initiative               integer,
    "currentInitiative"      integer,
    "heroPoints"             integer,
    "currentHeroPoints"      integer,
    "magicPoints"            integer,
    "currentMagicPoints"     integer,
    "faithPoints"            integer,
    "currentFaithPoints"     integer,
    "protectionIndex"        integer,
    "currentProtectionIndex" integer,
    level                    integer,
    "experiencePoints"       integer,
    "isKnown"                boolean      default false             not null,
    "controlUserId"          varchar(255)
                                                                    references "User"
                                                                        on update cascade on delete set null,
    "createdAt"              timestamp(3) default CURRENT_TIMESTAMP not null,
    "updatedAt"              timestamp(3)                           not null,
    image                    text,
    edit                     boolean      default true              not null
);

alter table "Character"
    owner to yeyokp_rpg;

